import React from 'react';
import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';
import { cn } from '@/lib/utils';
import {
    Linkedin,
    Facebook,
    Instagram,
    Mail
} from 'lucide-react';

interface FooterColumn {
    title: string;
    items: string[];
}

const footerColumns: FooterColumn[] = [
    {
        title: 'Services',
        items: [
            'SEO',
            'Social Media Marketing',
            'UI/UX',
            'Website Design',
            'Mobile Application Development',
            'Shopify Website Development',
            'Manual Testing Services',
            'Automation Testing Services',
        ],
    },
    {
        title: 'Industries',
        items: ['Education', 'Health Care', 'Retail & E-Commerce', 'Renewable Energy', 'All'],
    },
    {
        title: 'Platforms',
        items: [
            'Microsoft Services',
            'AWS',
            'Google Cloud',
            'Wordpress',
            'Magento',
            'Office 365 & Teams',
        ],
    },
];

const Footer = () => {
    return (
        <footer
            className={cn(
                'bg-gray-900 text-gray-300 py-12 md:py-16',
                'border-t border-gray-800' // Subtle top border
            )}
        >
            <div
                className={cn(
                    'container mx-auto px-4 md:px-8',
                    'grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8', // Responsive grid layout
                    'max-w-7xl' // Added max width
                )}
            >
                {/* Columns */}
                {footerColumns.map((column, index) => (
                    <div key={index} className="space-y-4">
                        <h3
                            className={cn(
                                'text-lg font-semibold text-white', // White title
                                'mb-4'
                            )}
                        >
                            {column.title}
                        </h3>
                        <ul className="space-y-2">
                            {column.items.map((item, i) => (
                                <li
                                    key={i}
                                    className={cn(
                                        'hover:text-blue-400 transition-colors', // Hover effect
                                        'text-gray-400'
                                    )}
                                >
                                    {item}
                                </li>
                            ))}
                        </ul>
                    </div>
                ))}

                {/* Newsletter Subscription */}
                <div className="space-y-4">
                    <h3 className="text-lg font-semibold text-white mb-4">Subscribe To Our Newsletter</h3>
                    <p className="text-gray-400 mb-4">
                        To get the latest news and latest updates.
                    </p>
                    <div className="flex flex-col sm:flex-row gap-2">
                        <Input
                            type="email"
                            placeholder="Email Address"
                            className={cn(
                                'bg-gray-800 text-white border-gray-700', // Dark input field
                                'placeholder:text-gray-500',
                                'w-full sm:w-auto'
                            )}
                        />
                        <Button
                            variant="default"
                            className={cn(
                                'bg-blue-500 text-white hover:bg-blue-600', // Blue button
                                'px-6 py-3',
                                'rounded-md',
                                'flex items-center gap-2',
                                'w-full sm:w-auto'
                            )}
                        >
                            <Mail className="w-4 h-4" />
                            SUBSCRIBE
                        </Button>
                    </div>
                    {/* Social Icons */}
                    <div className="flex gap-4 mt-4">
                        <a
                            href="#"
                            className={cn(
                                'text-gray-400 hover:text-blue-500 transition-colors',
                                'hover:scale-110'
                            )}
                            aria-label="LinkedIn"
                        >
                            <Linkedin className="w-6 h-6" />
                        </a>
                        <a
                            href="#"
                            className={cn(
                                'text-gray-400 hover:text-blue-600 transition-colors',
                                'hover:scale-110'
                            )}
                            aria-label="Facebook"
                        >
                            <Facebook className="w-6 h-6" />
                        </a>
                        <a
                            href="#"
                            className={cn(
                                'text-gray-400 hover:text-pink-500 transition-colors',
                                'hover:scale-110'
                            )}
                            aria-label="Instagram"
                        >
                            <Instagram className="w-6 h-6" />
                        </a>
                    </div>
                </div>
            </div>
            {/* Cookies Notice */}
            <div
                className={cn(
                    'bg-gray-800 text-gray-400 py-4 mt-8', // Dark background for notice
                    'text-center text-sm',
                    'border-t border-gray-700'
                )}
            >
                We use Cookies in this website to give you the best experience of our website. To find
                out more, read our{' '}
                <a href="#" className="text-blue-400 hover:underline">
                    Cookie policy
                </a>{' '}
                and{' '}
                <a href="#" className="text-blue-400 hover:underline">
                    Privacy policy
                </a>
                .
            </div>
        </footer>
    );
};

export default Footer;
